    inline Eigen::Vector4d construct_hvector(double w, const Eigen::VectorXd input);
    inline Eigen::VectorXd compute_coeffs_valtonenornhag_wacv_2021_fHf(const Eigen::VectorXd& data);
    inline Eigen::VectorXd solver_valtonenornhag_wacv_2021_fHf(const Eigen::VectorXd& data);
    inline double normalize2dpts(const Eigen::MatrixXd &pts);

    int homography_valtonenornhag_wacv_2021_fHf(
        const std::vector<Eigen::Vector3d> &p1,
        const std::vector<Eigen::Vector3d> &p2,
        const Eigen::Matrix3d &R1,
        const Eigen::Matrix3d &R2,
        std::vector<Eigen::Matrix3d> *H,
        std::vector<double> *f
    ) {
        // This is a 2-point method
        int nbr_pts = 2;

        Eigen::Matrix2d x1t;
        Eigen::Matrix2d x2t;
        for (int i=0; i < nbr_pts; i++) {
            x1t.col(i) = p1[i].hnormalized();
            x2t.col(i) = p2[i].hnormalized();
        }

        // We expect inhomogenous input data, i.e. p1 and p2 are 2x3 matrices
        int nbr_coeffs = 26;

        // Save copies of the inverse rotation
        Eigen::Matrix3d R1T = R1.transpose();
        Eigen::Matrix3d R2T = R2.transpose();

        // Compute normalization matrix
        double scale1 = normalize2dpts(x1t);
        double scale2 = normalize2dpts(x2t);
        double scale = std::max(scale1, scale2);
        Eigen::Vector3d s;
        s << scale, scale, 1.0;
        Eigen::DiagonalMatrix<double, 3> S = s.asDiagonal();

        // Normalize data
        x1t = scale * x1t;
        x2t = scale * x2t;

        // Wrap input data to expected format
        Eigen::VectorXd input(nbr_coeffs);
        input << x1t.col(0),
                 x2t.col(0),
                 x1t.col(1),
                 x2t.col(1),
                 Eigen::Map<Eigen::VectorXd>(R1T.data(), 9),
                 Eigen::Map<Eigen::VectorXd>(R2T.data(), 9);

        // Extract w (only real-valued solutions)
        Eigen::VectorXd w = solver_valtonenornhag_wacv_2021_fHf(input);

        // Pre-processing: Remove complex-valued solutions
        Eigen::Vector4d hvec;
        Eigen::Matrix3d K, Ki, Htmp;
        double tol = 1e-13;
        double err;
        Eigen::Vector3d z;

        for (int i = 0; i < w.size(); i++) {
            // Compute algebraic error, and compare to other solutions.
            // Only use positive focal_lengths
            if (w[i] > 0) {
                // Compute h vector
                hvec = construct_hvector(w[i], input);

                // Two spurious solutions were added, corresponding to last element
                // equal to zero.
                if (std::abs(hvec(3)) > tol) {
                    Htmp = Eigen::Matrix3d::Identity(3, 3);
                    Htmp.col(1) = hvec.hnormalized();

                    K = Eigen::Vector3d(w[i], w[i], 1).asDiagonal();
                    Ki = Eigen::Vector3d(1, 1, w[i]).asDiagonal();
                    Htmp = S.inverse() * K * R2 * Htmp * R1T * Ki * S;

                    // Check validity
                    bool valid = true;
                    for (int i=0; i < nbr_pts; i++) {
                        z = Htmp * p1[i];
                        err = 1.0 - std::abs(z.normalized().dot(p2[i].normalized()));
                        if (err > tol) {
                            valid = false;
                            break;
                        }
                    }

                    // Package output
                    if (valid) {
                        H->push_back(Htmp);
                        f->push_back(w[i] / scale);
                    }
                }
            }
        }

        return H->size();
    }

    inline Eigen::Vector4d construct_hvector(double w, const Eigen::VectorXd input) {
        Eigen::VectorXd d(27);
        d << w, input;

        double s1 = d[0]*d[25];
        double s2 = d[0]*d[16];
        double t1 = s1 + d[7]*d[19] + d[8]*d[22];
        double t2 = d[3]*d[19] + s1 + d[4]*d[22];
        double t3 = d[5]*d[10] + s2 + d[6]*d[13];
        double t4 = d[1]*d[10] + d[2]*d[13] + s2;
        double u1 = d[0]*d[24];
        double u2 = d[0]*d[15];
        double u3 = d[0]*d[26];

        Eigen::Matrix<double, 4, 4> M;
        M << 0, -t4*(d[3]*d[20] + u3 + d[4]*d[23]), t4*t2, (d[1]*d[11] + d[2]*d[14] + d[0]*d[17])*t2,  // NOLINT
             -t4*t2,  t4*(d[3]*d[18] + u1 + d[4]*d[21]), 0, -(d[1]*d[9] + d[2]*d[12] + u2)*t2,  // NOLINT
             0, -t3*(u3 + d[7]*d[20] + d[8]*d[23]), t3*t1,  (d[5]*d[11] + d[0]*d[17] + d[6]*d[14])*t1,  // NOLINT
             -t3*t1,  t3*(u1 + d[7]*d[18] + d[8]*d[21]), 0, -(d[5]*d[9] + u2 + d[6]*d[12])*t1;  // NOLINT

        // Perform SVD
        Eigen::JacobiSVD<Eigen::Matrix<double, 4, 4>> svd(M, Eigen::ComputeFullV);

        // Extract hvector
        Eigen::Vector4d h = svd.matrixV().col(3);

        return h;
    }
    
    inline Eigen::VectorXd solver_valtonenornhag_wacv_2021_fHf(const Eigen::VectorXd& data) {
        Eigen::VectorXd coeffs = compute_coeffs_valtonenornhag_wacv_2021_fHf(data);
        // Solve for the roots using sturm bracketing
        double roots[6];
        Eigen::VectorXd tmp = coeffs.reverse();
        int n_sols = poselib::sturm::bisect_sturm<6>(tmp.data(), roots);
        Eigen::VectorXd out(Eigen::Map<Eigen::VectorXd>(roots, n_sols));
        return out;
    }

